import Auth from "@/models/Auth";
import axios from "axios";

export default (to, from, next) => {
  let isLogged = true;

  axios.get('validate-token').then(response => {
    console.log(response);
  })

  if (isLogged) {
    next();
  }

  /*
  if( !Auth.check() ) {
    next({ name: 'login' });
  }
  */
}
